clc
clear all
close all
fm=500;
fc=5000;
n_bit=1000;
no_of_cycles=fc/(2*fm);
count=100000;
T=0.1;
% t=0.02/count:0.000005:n_bit/(2*fm); %bit duration = 1/(2*fm)
t=0.00001:0.00001:1;
amp=0.03;
% N=1;
rng(2);
% s=square(2*pi*fm*t);
sum1 = [];
for i=1:n_bit
    bit_01(i)=randi([0,1],1,1);
    bits(i)=2*bit_01(i)-1;
end

for i=1:count
    bb(i)=1;
end

for i=1:n_bit
    for j=1:count/n_bit
        sq_samples((i-1)*count/n_bit+j)=bits(i)*bb(j);
    end
end




